import React from 'react'
import 'singlePost.css'

const cstyle = {
    width: "16vw",
    height: "16vw",
    marginLeft: "2vw",
}

const SinglePost = () => {
    return (
        <>
            <div className="images">
            <img style= { cstyle } src="https://picsum.photos/800/600"></img>
            </div>
        </>    
    )
}

export default SinglePost;
;
